import React from 'react';
import Loader from './Loader.js';
import TextColorizer from './TextColorizer.js';

class Header extends React.Component {

    constructor(props) {
        super(props);
        this.company = this.props.company;
    }

    render() {
        const navClasses = "width-100-percent white header mt-2 faded bg-dark p-10";

        return (
            <div className="App ">
                <div className="flexContainer header">
                    <div className="flex3Column bg-green" />
                    <div className="flex3Column bg-yellow" />
                    <div className="flex3Column bg-red" />
                </div>
                <div class={navClasses} onClick={siteNavClick}>
                    <button>Home</button> / <button>BowlBuilder</button> / <button>TempConverter</button> / <button>Essay</button> / <button>Reservation</button> / <button>GuestList</button> / <button>SurfLog</button>
                </div>
                <Loader />
                <TextColorizer text={this.company}/>
            </div>
        );
    };
}

export default Header;
